/*********************************************************************
*
*       _DrawBk
*/
static void _DrawBk(int Logo) {
  int xSize, ySize;

  //
  // Get/Set values
  //
  xSize = LCD_GetXSize();
  ySize = LCD_GetYSize();
  GUI_SetColor(GUI_WHITE);
  GUI_SetTextMode(GUI_TM_NORMAL);
  //
  // Clear background
  //
  GUI_SetBkColor(GUI_BLACK);
  GUI_Clear();
  //
  // Draw Logo
  //
  if (Logo) {
    GUI_DrawBitmap(&bmSTLogo70x35, LOGO_DIST, LOGO_DIST);
  }
  //
  // Draw msec/picture
  //
  if (_ShowMSec) {
    GUI_SetFont(&GUI_FontRounded16);
    GUI_DispStringAt(STR_MSEC, 10, ySize - MSP_DIST_BOTTOM);
    GUI_DispDecAt(0, 10, ySize - MSP_DIST_BOTTOM + 17, 3);
  }
  //
  // Draw gear
  //
  if (_ShowGear) {
    GUI_SetFont(FONT_GEAR);
    GUI_DispStringHCenterAt(STR_GEAR, xSize >> 1, (ySize - GUI_GetFontDistY()) >> 1);
  }
}

/*********************************************************************
*
*       _WriteGear
*
*   Description: Show current gear
*/
static void _WriteGear(int Gear) {
  int xSize, ySize;

  if (_ShowGear) {
    if (_OldGear != Gear) {
      xSize = LCD_GetXSize();
      ySize = LCD_GetYSize();
      _OldGear = Gear;
      GUI_SetColor(GUI_WHITE);
      GUI_SetTextMode(GUI_TM_NORMAL);
      GUI_SetFont(FONT_GEAR);
      GUI_DispDecAt(Gear, ((xSize + GUI_GetStringDistX(STR_GEAR) + 1) >> 1) - GUI_GetCharDistX('1'), (ySize - GUI_GetFontDistY()) >> 1, 1);
    }
  }
}

/*********************************************************************
*
*       _GetAngle_0
*/
static float _GetAngle_0(int tDiff) {
  // Gear 1
  if ((tDiff >= 0)    && (tDiff <  1000)) {                return 225 - 15 - 0.075  *  tDiff;         }
  if ((tDiff >= 1000) && (tDiff <  1250)) {                return 225 - 90 + 0.3    * (tDiff - 1000); }
  // Gear 2
  if ((tDiff >= 1250) && (tDiff <  3250)) { _WriteGear(2); return 225 - 15 - 0.0375 * (tDiff - 1250); }
  if ((tDiff >= 3250) && (tDiff <  3500)) {                return 225 - 90 + 0.3    * (tDiff - 3250); }
  // Gear 3
  if ((tDiff >= 3500) && (tDiff <  6000)) { _WriteGear(3); return 225 - 15 - 0.03   * (tDiff - 3500); }
  if ((tDiff >= 6000) && (tDiff <  6250)) {                return 225 - 90 + 0.3    * (tDiff - 6000); }
  // Gear 4
  if ((tDiff >= 6250) && (tDiff <  9250)) { _WriteGear(4); return 225 - 15 - 0.025  * (tDiff - 6250); }
  if ((tDiff >= 9250) && (tDiff <  9500)) {                return 225 - 90 + 0.3    * (tDiff - 9250); }
  // Gear 5
  if ((tDiff >= 9500) && (tDiff < 15000)) { _WriteGear(5); return 225 - 15 - 0.0035 * (tDiff - 9500); }
  return 225 - 90;
}

/*********************************************************************
*
*       _GetAngle_1
*/
static float _GetAngle_1(int tDiff) {
  // Gear 1
  if ((tDiff >=    0) && (tDiff < 1000))  { return 225 -      0.02   *  tDiff;         }
  if ((tDiff >= 1000) && (tDiff <  1250)) { return 225 - 20;                           }
  // Gear 2
  if ((tDiff >= 1250) && (tDiff <  3250)) { return 225 - 20 - 0.01   * (tDiff - 1250); }
  if ((tDiff >= 3250) && (tDiff <  3500)) { return 225 - 40;                           }
  // Gear 3
  if ((tDiff >= 3500) && (tDiff <  6000)) { return 225 - 40 - 0.004  * (tDiff - 3500); }
  if ((tDiff >= 6000) && (tDiff <  6250)) { return 225 - 50;                           }
  // Gear 4
  if ((tDiff >= 6250) && (tDiff <  9250)) { return 225 - 50 - 0.004  * (tDiff - 6250); }
  if ((tDiff >= 9250) && (tDiff <  9500)) { return 225 - 62;                           }
  // Gear 5
  if ((tDiff >= 9500) && (tDiff < 15000)) { return 225 - 62 - 0.0012 * (tDiff - 9500);
  }
  return 225 - 90;
}

